Art. 25. …
(...)
II - formalizar a concessão de estágio com a instituição de ensino e o(a) estudante dentre os incisos I, II ou
III do artigo 7º e zelando por seu cumprimento;
III – disponiilizar instalações que tenham condições de proporcionar ao(à) estudante, atividades de
aprendizagem social, profissional e cultural;
IV - indicar funcionário(a) de seu quadro de pessoal, com formação ou experiência profissional na área de
supervisionar até 10 (dez) estagiários(as) simultaneamente;
V - contratar em favor do(a) Estagiário(a) seguro contra acidentes pessoais, nos termos do Art. 9º. da Lei
n. 11788/2008, quando o(a) estudante já não o possuir;
VI - entregar ao(à) responsável pelo setor de estágio o formulário de frequência e a avaliação do supervisor;
(...)
VIII - promover a seleção dos(as) candidatos(as) a estágio, se necessário;
(...)
§ 2º Compete ao(à) supervisor(a) de estágio na concedente:
I - colaborar com o(a) professor(a) orientador(a) nas atividades relacionadas ao estágio;
(...)
IV - supervisionar, acompanhar e avaliar o(a) estudante durante toda a realização do estágio;
(...)
Art. 26. …
I - colaborar com o(a) professor(a) orientador(a) nas atividades relacionadas ao estágio;
II - Encaminhar os(as) estudantes ao setor de estágio do campus, informando-lhes o papel dos diferentes
atores envolvidos na formalização do estágio;
III - Orientar os(as) estudantes com relação às normas e procedimentos para a realização do estágio;
IV - Informar aos(às) estudantes os prazos, critérios e metodologias de avaliação do estágio;
V - Lançar no diário a pontuação final obtida pelo(a) estudante na unidade curricular Estágio.
Art. 27. …
(...)
II - elaborar, juntamente com o(a) professor(a) orientador(a) e com o(a) supervisor(a) de estágio, o plano
de atividades, que será anexado ao Termo de Compromisso de Estágio;
III - fornecer à coordenação de estágio: declaração de matrícula do período da solicitação e do período da
realização do estágio, cópia da apólice de seguro, requerimento de estágio previamente autorizado pelo(a)
Coordenação de Curso e pelo(a) seu(sua) professor(a) orientador(a);
IV - procurar a Coordenação/Setor de Estágio, sempre que necessário, com a finalidade de obter
informações sobre os procedimentos para realização, avaliação e validação do estágio;
(...)
